def derivative(xs: list):
    """Return the derivative of a polynomial represented by its coefficients."""
    return [i * xs[i] for i in range(1, len(xs))]

def fibfib(n: int):
    if n == 0 or n == 1:
        return 0
    elif n == 2:
        return 1
    a, b, c = 0, 0, 1
    for _ in range(3, n + 1):
        a, b, c = b, c, a + b + c
    return c

