def search(lst):
    from collections import Counter
    freq = Counter(lst)
    for num in sorted(freq.keys(), reverse=True):
        if freq[num] >= num:
            return num
    return -1

def triangle_area(a, b, c):
    if a + b > c and a + c > b and b + c > a:
        s = (a + b + c) / 2
        area = (s * (s - a) * (s - b) * (s - c)) ** 0.5
        return round(area, 2)
    else:
        return -1

